Having followed the notes and linked instructions in the Prerequisites section, you are ready to add global support for the LFE rebar3 plugin. First, unless you have configured other rebar3 plugins on your system, you will need to create the configuration directory and the configuration file: $ mkdir ~/.config/rebar3
$ touch ~/.config/rebar3/rebar.config Next, open up that file in your favourite editor, and give it these contents: {plugins, [ {rebar3_lfe, {git, "https://github.com/lfe-rebar3/rebar3_lfe.git", {branch, "master"}}}
]}. If you already have a rebar.config file with a plugins entry, then simply add a comma after the last plugin listed and paste the {rebar3_lfe, {...}} line from above (with no trailing comma!). For Windows users XXX For Windows users Some notes on compatibility: While LFE, Erlang, and rebar3 work on *NIX, BSD, and Windows systems, much of the development the community does occurs predominently on the first two and sometimes Windows support is spotty and less smooth than on the more used platforms (this is more true for rebar3 and LFE, and _most_ true for LFE). In particular, starting a REPL in Windows can take a little more effort (an extra step or two) than it does on, for example, Linux and Mac OS X machines.
